(()=>{"use strict";(()=>{const t=document.getElementById("timer-hours"),e=document.getElementById("timer-minutes"),n=document.getElementById("timer-seconds"),o=()=>{const r=(()=>{const t=(new Date("14 october 2024").getTime()-(new Date).getTime())/1e3;return{timeRemaining:t,hours:Math.floor(t/60/60).toString().padStart(2,"0"),minutes:Math.floor(t/60%60).toString().padStart(2,"0"),seconds:Math.floor(t%60).toString().padStart(2,"0")}})();r.timeRemaining<0?(t.textContent="00",e.textContent="00",n.textContent="00",clearInterval(o)):(t.textContent=r.hours,e.textContent=r.minutes,n.textContent=r.seconds)};o(),setInterval(o,1e3)})()})();